import header__logo from '../../images/header__logo.svg';
import { NavLink } from 'react-router-dom';
import NavBar from '../NavBar/NavBar';

function Header(props) {
    return (
        <header className="header">
            <img className="header__logo" src={header__logo} alt="Логотип" />
            {/* неавторизированый */}
            <nav className="header__container">
                {/* <NavLink className="UnauthorizedHeader__link" to={`/${props?.path}`} onClick={props?.signOut} >Регистрация</NavLink> */}
                <NavBar name={"Регистрация"} path={"sign-up"} signOut={props.signOut} className={"navigation__link"}/>
                <NavLink className="UnauthorizedHeader__enter-button" to={`/${props?.path}`} onClick={props?.signOut} >Войти</NavLink>
            </nav>
            {/* авторезированый */}
        </header>
    )
}

export default Header
